import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Row, Col, FormGroup, Label, Input , UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem , Button} from "reactstrap";

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {

    }
  }
  render() {
    return (
      <div className="App">
        <header className = "App-header">
          <Row className = "Header-row">
            <Col>
              <Label>Username : </Label>
              <Input></Input>
              <Button className = "App-button">Submit</Button>
              <div style = {{'text-align' : 'right'}}>
              <img src={logo} className="App-logo" alt="logo" />
              </div>
            </Col>
          </Row>
        </header>

        <body className = "App-body">
          <Row>
            <Col>
              <h2>User Profile</h2>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Location : </Label>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Email : </Label>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Bio : </Label>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Profile link : </Label>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Total Number of Starred Repo's : </Label>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Followers : </Label>
              <Label></Label>
            </Col>
          </Row>

        </body>
      </div>
    );
  }
}
